    const [item, setItem] = useState("") // item do menuApi


    return (
        <div className="navBarLayout hidden">
            <ul>
                {
                   menuItems.map((a) => (
                       <li
                       className="items"
                       >
                         <a>
                            {a.item}
                         </a>
                       </li> 
                    ))
                }
            </ul>
        </div>
    )
}
